;;; {"type":"html","content":"<span class='clj-var'>#&#x27;unsightly-reserve/all-delays</span>","value":"#'unsightly-reserve/all-delays"}
;; <=

;; @@
(short-metrics (->> all-delays flatten (remove #(= 0 %)) (pmap (comp float #(/ % 60)))))
