(def improved-summary
  (vec
  (pmap 
    (fn [r] 
      (assoc r :user 
        (:screen_name
          (mc/find-map-by-id @db "users" (:user (mc/find-map-by-id @db "publications" (:source r)))))))
    short-summary)))
