;; @@

(let [sizes (map :size improved-summary)
       users (map :user improved-summary)
       dat {:users users :sizes sizes}]
    (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :users :sizes {:fill :users}]]
       [:geom_boxplot]
       [:ylab "Tree Size"]
       [:xlab "News Sources"]
       [:ggtitle "Tree Sizes of News Articles"]
       [:scale_x_discrete {:breaks "NULL"}]
       #_[:theme {:legend.position "none"}]
       )]
      {:width 12
       :height 5}))
